DROP TABLE IF EXISTS clientes;
CREATE TABLE clientes(
   Codigo     INTEGER AUTO_INCREMENT
  ,Nome       VARCHAR(46) NOT NULL
  ,Endereco   VARCHAR(44)
  ,Número     INTEGER 
  ,Bairro     VARCHAR(21)
  ,Cidade     VARCHAR(12)
  ,UF         VARCHAR(2)
  ,CEP        VARCHAR(9)
  ,email      VARCHAR(32)
  ,Telefone   VARCHAR(15)
  ,Celular    VARCHAR(14)
  ,Contato    VARCHAR(19)
  ,Tecnico    VARCHAR(5)
  ,Complemento  VARCHAR(15)
  ,Foto       VARCHAR(110)
,CONSTRAINT pk_clientes PRIMARY KEY(Codigo)) ENGINE = InnoDB COLLATE = latin1_general_ci;

